    false,nt"url": null,nt"notes": "Citywide Class Size Report, including Region,
    District, School, Program, Grade or Service Category, Average Class Size, and Pupil
    / Teacher Ratio (PTR) rnrnSOURCES: 10/31/06 Official Register (K-9) and 12/15/06
    Register/Schedule (9-12)rn#Grade 9 not in high schoolsrn##Indicates how special
    class is deliveredrnrnFor schools with students in any grades between Kindergarten
    and 9th grade (where 9th grade is the termination grade for the school), class size
    is reported by four program areas: general education, special education self-contained
    class, collaborative team teaching and gifted and talented self-contained class.
    Within each program area class size is reported by grade or service category, which
    indicates how a special education self-contained class is delivered. Class size
    is calculated by dividing the number of students in a program and grade by the number
    of official classes in that program and grade. rnrnThe following data is excluded
    from all the reports: District 75 schools, bridge classes which span more than one
    grade, classes with fewer than five students (for other than special education self-contained
    classes) and classes with one student (for special education self-contained classes).
    On the summary reports programs and grades with three or fewer classes are excluded
    from the citywide, borough and region reports and programs and grades with one class
    are excluded from the district report. For schools with students in any grades between
    9th and 12th grade (where 9th grade is not the termination grade for the school),
    class size is reported by two program areas: general education and special education.
    For general education students class size is reported by grade for each core subject
    area: English, Math, Science and Social Studies. For special education students
    with a self-contained program recommendation, class size is reported by service
    category (self-contained or mainstream) for each core subject area. Since high school
    classes may contain students in multiple grades and programs, class size is calculated
    by taking a weighted average of all the classes in a core subject area with students
    in a particular grade or program. For example, there are 75 ninth graders enrolled
    at a high school. 25 ninth graders attend a Math class with 28 students, a second
    group of 25 ninth graders attend a Math class with 25 students, and a third group
    of 25 ninth graders attend a Math class with 30 students. Average class size for
    ninth grade Math equals: (25x28 + 25x25 + 25x30)/75 = 27.7. rnrnThe Pupil Teacher
    Ratio is also provided on the school level report. Pupil Teacher Ratio is another
    means to evaluate the instructional resources provided at a school. Pupil Teacher
    Ratio for All Students is calculated by dividing the number of students at a school
    by the number of full-time equivalent teachers, including both teachers in classes
    taught by two teachers, u201cclusteru201d teachers providing instruction in specialized
    topics like art or science, and teachers providing special education instruction.
    Pupil Teacher Ratio Excluding Special Education is calculated by dividing the number
    of non-special education students at a school by the number of full-time equivalent
    non-special education teachers.",nt"license_title": "License Not Specified",nt"extras":
